const Person = () => {
  return(
      <div className='center'>
      <h4 className='container center'>Person Information</h4>
      <br/ >
      <h6>Name:<input type="text" /></h6>
      <h6>Birth Date:<input type="text"/></h6>
      <h6>About Me:<input type="text"/></h6>
      <input type="submit"/>
      </div>
  )
}
export default Person;
